import { HTMLMorph } from "lively.morphic";
import * as vis from "https://lively-web.org/users/MattH/uploads/vis.js"
import { deepCopy } from "lively.lang/object.js";

import WebDAVResource from "lively.resources/src/http-resource.js";

export default class NBAVisMorph extends HTMLMorph {
  onLoad(){
  this.loadGraph();
  }
  async loadGraph() {     
      this.viscanvasId = 'vis-canvas-' + this.id
      var htmlString = '<div style="height:100%" id="' + this.viscanvasId + '"/><//div>'
      this.html = htmlString;
      var DataObject = await this.getData(),
      nodeArray = DataObject.nodes,
      edgeArray = DataObject.edges     
      var nodes = new vis.DataSet(nodeArray)  
  var edges = new vis.DataSet(edgeArray)

  var container = this.domNode.querySelector('#' + this.viscanvasId)
  this.data = {
    nodes: nodes,
    edges: edges
  };

  this.options = {
  interaction:{hover:true},

  manipulation: {
    addEdge: this.addEdge
  },

  physics:{
    enabled: false,
    repulsion: {
      centralGravity: 0.5,
      springLength: 200,
      springConstant: 0.05,
      nodeDistance: 100,
      damping: 0.09
    },
    maxVelocity: 50,
    minVelocity: 0.1,
    solver: 'repulsion',
    stabilization: {
      enabled: true,
      iterations: 2500,
      updateInterval: 10,
      onlyDynamicEdges: false,
      fit: true
    },
        timestep: 0.5,
        adaptiveTimestep: true
  },
  layout: {
    hierarchical: {
      enabled:false
    },
    randomSeed: 1,
    improvedLayout:true
  }
}


  this.network = new vis.Network(container, this.data, this.options);

  var self = this;
  this.data.nodes.forEach(function(node){
    if (node.group && node.level < 3){
      var nodeId = node.Id
      //If node is 'clusterable', it is of level less than 3 (which is a leaf node)
      var group = node.group;
      var clusterOptionsByData = self.getClusterByData(self,nodeId,node, group)
      self.network.cluster( clusterOptionsByData);
    }
  })

  this.network.fit()

  this.options.physics.enabled = true
  this.network.setOptions(this.options)

  this.singleClickListener(this)
  this.doubleClickListener(this)
  this.longClickListener(this)
  this.hoverListener(this)
  this.blurListener(this)
  this.rightClickListener(this)
  this.dragStartListener(this)
  this.dragListener(this)
  this.dragEndListener(this)

  this.addLoadingBar(this,container)

  }
   singleClickListener(self) {
    var network = this.network;
    var hand = $world.hands[0]
    network.on("click", function (params) {
      var node = params.nodes[0]
      if(!node){
        return
      }
    })
  }
  showTooltip(obj, blur) {
    var container = this.domNode.querySelector('#' + this.viscanvasId)
    var nodeDelete = this.domNode.querySelector('#tooltipNode');
    if(nodeDelete){
       container.removeChild(nodeDelete);   
       if(blur){
           return;
       }
    }
    var tt = document.createElement("div");
    tt.setAttribute("id", "tooltipNode");
    tt.setAttribute("class", "tooltipNode");
    this.setTTStyle(tt)

    var title = ( obj.tt == undefined ) ? ""  : obj.tt;
    tt.innerHTML = title;
    container.appendChild(tt);
  }
  hoverListener(self) {
     this.network.on("hoverNode", function (params) {         
        var HOVER_SIZE_ICON = 50;
        var nodeId = params.node;
        var node = self.data.nodes.get(nodeId.split('_cluster')[0]);//If cluster, display inner node tooltip
        self.showTooltip(node); 

    });
  }  
  setTTStyle(tt) {  
    tt.setAttribute("style","position: absolute;\
	   text-align: left;\
	   top: 5%;\
    left: 20px;\
    background-color: #FFFFFF;\
    font-family: Roboto, Ubuntu, Verdana, Arial;\
    font-size: 0.65em;\
    padding: 5px;\
    border-radius: 5px;\
    border: solid 4px;\
    min-width: 0px;\
    max-width: 50%;\
    min-height: 0px;\
    max-height: 80%;")
  }
  blurListener(self){
    var network = this.network;
    network.on("blurNode", function (params) {      
      var node = self.data.nodes.get(params.node);
      self.hideTooltip();
    });
  }
  hideTooltip(){
    var container = this.domNode.querySelector('#' + this.viscanvasId)
    var nodeDelete = this.domNode.querySelector('#tooltipNode');
    if(nodeDelete){
        container.removeChild(nodeDelete);    
    }
  }
  longClickListener(self) {
    var network = this.network;
    network.on("hold", function (params) {      
      var node = params.nodes[0]
      if(node){
        //duplicate node here
        var nodeObj = self.data.nodes.get(node)
        var tempNode = deepCopy(nodeObj)
        tempNode.label = nodeObj.label + '_1'
        tempNode.id = nodeObj.id + '_1'
        self.data.nodes.update(tempNode)
      } else {
        //create node here
        var nodeCount = self.data.nodes.length + 1
        var {x,y} = params.pointer.canvas
        var nodeObj = {id: nodeCount, label: 'Node ' + nodeCount, tt: 'Node ' + nodeCount, x: x, y: y}
        console.log(params)
        self.data.nodes.update(nodeObj)
      }

    })
  }
  doubleClickListener(self) {
    var network = this.network;
    network.on("doubleClick", async function (params) {

        var nodeId = params.nodes[0]
        var node = self.data.nodes.get(nodeId)

        if (self.network.isCluster(nodeId) == true){
        //If selection is cluster
          console.log(nodeId)
          self.network.openCluster(nodeId);
        } else {
        //If selection is not cluster
          if ((node.group || node.League || node.conference ) && node.level < 3){
            //If node is 'clusterable', it is of level less than 3 (which is a leaf node)
            var group;
            if (node.level == 0){
              group = node.League
            }
            if (node.level == 1){
              group = node.conference
            }
            if (node.level == 2){
              group = node.group;
            }


            var clusterOptionsByData = self.getClusterByData(self,nodeId,node, group)          
            self.network.cluster( clusterOptionsByData);


            return
          }
          if (params.nodes.length > 0){
            var editor = $world.get('NodeEditor')
            if (!editor){                         
              editor = await loadObjectFromPartsbinFolder("NodeEditor");
              editor.openInWorld();
            }
            editor.node = node
            editor.saveTarget = self         
            editor.get('container').makeFields(node)            
            editor.bringToFront();
          }
      }
    })
  }
  rightClickListener(self) {
    var network = this.network;
    network.on("oncontext", function (params) { })
  }
  dragStartListener(self){
    var network = this.network;
    network.on("dragStart", function (params) {

    })
  }
  dragListener(self){
    var network = this.network;
    network.on("dragging", function (params) { })
  }
  dragEndListener(self){
    var network = this.network;
    network.on("dragEnd", function (params) {

    })
  }
  addEdge(data,callback) {
    $world.get('cancelButton').visible = false    
    callback(data);

  }
  addNode(data,callback){
  }
  onResize(evt) {
    console.log(evt)
  }
  makeTextField(k,v) {
    console.log({k,v})
  }
  async getData() {
    var nbaData = new URL( 'https://raw.githubusercontent.com/m-hemmings/MiscFiles/master/lively.next/RostersByTeamAndPosition.json')
    var teamURL = new URL ('https://raw.githubusercontent.com/m-hemmings/MiscFiles/master/lively.next/NBAteams.json')
    function getJSON(url) {
      'use strict';
        var xhr = new XMLHttpRequest();
        return new Promise((resolve, reject) => {
          xhr.onreadystatechange = function () {
            if (xhr.readyState === 4) {
              if (xhr.status === 200) {
                resolve(JSON.parse(xhr.responseText));
              } else {
                reject(xhr.responseText);
              }
            }
          };
          xhr.open('GET', url);
          xhr.send();
        });
      }  
      var players = await getJSON(nbaData)
      var teams = await getJSON(teamURL)
      var nodes = []
      var edges = []

      nodes.push({
        id: "NBA_Logo",
        tt: "NBA",
        label: "NBA",
        League: "NBA",
        shape: "image",
        level: 0,
        image: "https://upload.wikimedia.org/wikipedia/en/thumb/0/07/NBALogo.svg/197px-NBALogo.svg.png"
      })

      nodes.push({
        id: "Western_Conference",
        tt: "Western Conference",
        label: "Western Conference",
        conference: "Western",
        League: "NBA",
        shape: "image",
        level: 1,
        image: "https://upload.wikimedia.org/wikipedia/en/0/02/Western_Conference_%28NBA%29_logo.gif"
      })

      nodes.push({
        id: "Eastern_Conference",
        tt: "Eastern Conference",
        label: "Eastern Conference",
        conference: "Eastern",
        League: "NBA",
        shape: "image",
        level: 1,
        image: "https://upload.wikimedia.org/wikipedia/en/e/ed/Eastern_Conference_%28NBA%29_logo.gif"
      })

      edges.push({from: "Western_Conference", to: "NBA_Logo", length: 100})
      edges.push({from: "Eastern_Conference", to: "NBA_Logo", length: 100})

      teams.forEach(team =>{
        var item = {
          id: team.Team,
          tt: team.City + '<BR>' + team.Team,
          label: team.City + '\n' + team.Team,
          level: 2,
          ...team
        }
        nodes.push(item)
        edges.push({from: item.id, to: team.conference + "_Conference", length: 100})
      })

      players.forEach(player =>{
        var tt = this.getPlayerInfo(player)

        var item = {
        id: player.Name + '_' + player.Team,
        tt: tt,//player.Name + '<BR>' + player.City + ' ' + player.Team,
        label: player.Name,
        level: 3,
        ...player
        }

        var team = teams.filter(function(ea){
        return ea.Team == player.Team
        })[0]

        item.conference = team.conference
        item.League = team.League

        nodes.push(item)        
        edges.push({from: item.id, to: player.Team})
      })
      console.log('done')
      return {nodes,edges}

    }
  stabilizationStart(self) {
    var network = self.network
    network.on("stabilizationProgress", function(params) {
    })
  }
  stabilizationEnd(self) {
    var network = self.network
    network.once("stabilizationIterationsDone", function() {
    })
  }
  addLoadingBar(self,container) {
    var parts = ['loadingBar','outerBorder','text','border']
    var divs = []
    parts.forEach(function(ea){
      var temp = document.createElement("div");
      temp.setAttribute("id", ea);
      temp.setAttribute("class", ea);
      divs.push(temp)
    })
   console.log(divs)

  }

  getClusterByData(self,nodeId,node,group) {
    return {
              joinCondition:  function(childOptions){
                return (childOptions.Team == group || childOptions.conference == group || childOptions.League == group); // groups if Team is the same as the grouping value
              },
              clusterNodeProperties: {
                id: node.id + '_cluster',
                label: node.label,
                tt: node.tt,
                borderWidth:3,                
                image: node.image,
                shape: 'image',
                League: node.League,
                conference: node.conference
                }
          };
  }
  getPlayerInfo(player) {
    var tt = ''
    var fields = (Object.getOwnPropertyNames(player))
    fields.forEach(function(ea,i){
      var k = ea,
      v = player[ea]
      if (k != 'tt'){
        tt += '<B>' + k + ':</B> ' + v + '<BR>'
      }
    })
    return tt;
  }
  async getInstructions(cb) {
    var instructionText = await new WebDAVResource('https://raw.githubusercontent.com/m-hemmings/MiscFiles/master/lively.next/instructions.html').read()    
    cb(String(instructionText))
  }
}

